import Dashboard from "./components/Dashboard/Dashboard";
import Home from "./components/Home";
import Login from "./components/Login/Login";
import Contact from "./components/contact/contact";
import { BrowserRouter as Router, Route, Switch, useNavigate } from 'react-router-dom';
import ProtectedRoute from './ProtectedRoute';
import React, { useState } from 'react';

function App() {

  const [isAuthenticated, setIsAuthenticated] = useState(false); // Manage authentication state here
  history = useNavigate();

  return (
    <div className="App">
      <Router>
      <Switch>
        <Route path="/login" component={Login} />
        <ProtectedRoute path="/dashboard" component={Dashboard} isAuthenticated={isAuthenticated} />
        <ProtectedRoute path="/aboutus" component={Home} isAuthenticated={isAuthenticated} />
        <ProtectedRoute path="/contact" component={Contact} isAuthenticated={isAuthenticated} />
        <Redirect from="/" to="/login" />
      </Switch>
    </Router>
    </div>
  );
}


export default App;
